  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0115588 includes discrete
  sample and profile data collected from USCGC POLAR STAR in the Arctic Ocean from
  2002-08-19 to 2002-09-23. These data include Barium, CHLOROFLUOROCARBON-11 (CFC-11),
  CHLOROFLUOROCARBON-113 (CFC-113), CHLOROFLUOROCARBON-12 (CFC-12), DISSOLVED OXYGEN,
  Delta Oxygen-18, HYDROSTATIC PRESSURE, NITRATE, NITRITE, Potential temperature (theta),
  SALINITY, WATER TEMPERATURE, phosphate and silicate. The instruments used to collect
  these data include CTD and bottle.nnThese data were collected by Rebecca Woodgate
  of University of Washington; Applied Physics Laboratory as part of the PACIFICA_32PZ20020819
  data set. CDIAC associated the following cruise ID(s) with this data set: CBL 2002
  (AWS-02-II) and PACIFICA_32PZ20020819nnPACIFICA (PACIFic ocean Interior CArbon)
  was an international collaborative project for the data synthesis of ocean interior
  carbon and its related parameters in the Pacific Ocean. The North Pacific Marine
  Science Organization (PICES), Section of Carbon and Climate (S-CC) supported the
  project.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
